import React from "react";


const GlobalFooter = () => {
	return (
		<footer className="">
			<Row className="d-flex align-items-center">
				<Col>
					<h3>
						Creator: <br />
						SB Soko <br /> <br />
						Email Address: <br />
						{process.env.EMAIL}
						<br />
						Contact Number: <br />
						{process.env.CELL}
					</h3>
				</Col>
				<Col>
					<h3>
						Last Updated: <br />
						{process.env.LAST_UPDATED}
					</h3>
				</Col>
			</Row>
		</footer>
	);
};

export default GlobalFooter;
